import React from 'react';
import { BrowserRouter as Router, Route, Routes  } from 'react-router-dom';
import Home from './pages/Home';
import Header from './components/Header';

const App = () => {
    return (
        <Router>
            <Header />
            <main>
                <Routes>
                    <Route exact path="/" element={<Home />} /> s {/* Home page route */}
                    <Route exact path="/not" /> s {/* Home page route */}
                </Routes>
            </main>
        </Router>
    );
};

export default App;
